import React, { useState } from "react";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import FlipCameraAndroidIcon from "@material-ui/icons/FlipCameraAndroid";

const AboutUs = () => {
  const [check, setCheck] = useState({
    fullname: "",
    email: "",
    phonenumber: "",
    feedback: "",
  });
  const submitEvent = (event) => {
    if (
      check.fullname === "" &&
      check.email === "" &&
      check.phonenumber === "" &&
      check.feedback === ""
    ) {
      toast.error("entered field is not valid", {
        position: "bottom-center",
        autoClose: 5000,
        hideProgressBar: false,
        closeOnClick: true,
        pauseOnHover: true,
        draggable: true,
        progress: undefined,
      });
    } else {
      toast.success("Thanks for your visit", {
        position: "bottom-center",
        autoClose: 5000,
        hideProgressBar: false,
        closeOnClick: true,
        pauseOnHover: true,
        draggable: true,
        progress: undefined,
      });
      setCheck({
        fullname: "",
        email: "",
        phonenumber: "",
        feedback: "",
      });
    }
  };
  const checkEvent = (event) => {
    setCheck({
      fullname: event.target.value,
      email: event.target.value,
      phonenumber: event.target.value,
      feedback: event.target.value,
    });
    console.log(event.target.value);
  };
  return (
    <>
      <div class="container-fluid">
        <div class="container">
          <div class="row">
            <h1 class="text-center pt-4 text-uppercase">form</h1>
            <hr class="w-25 mx-auto " />
            <div class="container">
              <div class="row">
                <div class="col-6 mx-auto">
                  <form>
                    <div class="input-group input-group-sm mb-3">
                      <label class="input-group-text text-capitalize">
                        full name
                      </label>
                      <input
                        onChange={checkEvent}
                        value={check.fullname}
                        name="fullname"
                        type="text"
                        class="form-control"
                        aria-label="Sizing example input"
                        aria-describedby="inputGroup-sizing-sm"
                      />
                    </div>
                    <div class="input-group input-group-sm mb-3">
                      <label class="input-group-text text-capitalize">
                        email
                      </label>
                      <input
                        onChange={checkEvent}
                        value={check.email}
                        name="email"
                        type="email"
                        class="form-control"
                        aria-label="Sizing example input"
                        aria-describedby="inputGroup-sizing-sm"
                      />
                    </div>

                    <div class="input-group input-group-sm mb-3">
                      <label class="input-group-text text-capitalize">
                        phone number
                      </label>
                      <input
                        onChange={checkEvent}
                        value={check.phonenumber}
                        name="phonenumber"
                        type="number"
                        class="form-control"
                        aria-label="Sizing example input"
                        aria-describedby="inputGroup-sizing-sm"
                      />
                    </div>
                    <div class="input-group input-group-sm mb-3">
                      <label class="input-group-text text-capitalize">
                        feeback
                      </label>
                      <textarea
                        name="feedback"
                        onChange={checkEvent}
                        value={check.feedback}
                        class="form-control"
                        aria-label="Sizing example input"
                        aria-describedby="inputGroup-sizing-sm"
                      />
                    </div>
                    <div class="modal-footer">
                      <button
                        type="button"
                        onClick={submitEvent}
                        class="btn text-capitalize btn-outline-primary"
                      >
                        submit
                      </button>
                    </div>
                  </form>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
      <ToastContainer />
    </>
  );
};
export default AboutUs;
